  {name: "Asian Salad Box Lunch", image: nil, restaurant_id: 47, description: "Oven-roasted chicken breast, napa cabbage, carrots, toasted almonds, crisp chow mein noodles, sesame seeds, scallions & cilantro on mixed greens. Served with sesame ginger dressing. Includes rice crackers & fortune cookies, fresh fruit cup, schwartz brothers bakery oatmeal cookie, athena bottled water & utensils. "},
  {name: "Balsamic Chicken Salad Box Lunch", image: nil, restaurant_id: 47, description: "Grilled, balsamic-marinated chicken, parmesan, grilled red peppers & asparagus and cherry tomatoes on a bed of romaine, radicchio & arugula. Served with red balsamic vinaigrette. Includes a handmade roll & butter, fresh fruit cup, schwartz brothers bakery oatmeal cookie, athena bottled water & utensils."},
  {name: "Caesar Salad Box Lunch", image: nil, restaurant_id: 47, description: "Crisp romaine lettuce, freshly-baked homemade croutons & parmesan cheese. Served with traditional caesar dressing, a handmade roll and butter, freshly cut fruit, athena bottled water and a schwartz brothers bakery oatmeal cookie."},
  {name: "Chicken Caesar Salad Box Lunch", image: nil, restaurant_id: 47, description: "Grilled chicken breast, crisp romaine lettuce, freshly-baked homemade croutons & parmesan cheese. Served with traditional caesar dressing. Includes a handmade roll & butter, fresh fruit cup, schwartz brothers bakery oatmeal cookie, athena bottled water & utensils."},
  {name: "Chop Chop Salad Box Lunch", image: nil, restaurant_id: 47, description: "Oven-roasted chicken breast, genoa salami, mixed greens, basil, garbanzo beans, tomatoes, scallions, provolone & mozzarella. Served with balsamic vinaigrette. Includes a handmade roll & butter, fresh fruit cup, schwartz brothers bakery oatmeal cookie, athena bottled water & utensils."},
  {name: "Cobb Salad Box Lunch", image: nil, restaurant_id: 47, description: "Oven-roasted chicken breast, crisp bacon, avocado, crumbled bleu cheese, roma tomatoes, scallions & hard-boiled egg on crisp garden greens. Served with balsamic vinaigrette. Includes a handmade roll & butter, fresh fruit cup, schwartz brothers bakery oatmeal cookie, athena bottled water & utensils."},
