  {name: "Farmers Market Salad Box Lunch", image: nil, restaurant_id: 47, description: "Candied spiced walnuts, crumbled bleu cheese, dried cranberries, golden raisins & diced apples on a bed of fresh spinach & romaine. Served with raspberry vinaigrette. Includes a handmade roll & butter, fresh fruit cup, schwartz brothers bakery oatmeal cookie, athena bottled water & utensils."},
  {name: "Greek Tuna Salad Box Lunch", image: nil, restaurant_id: 47, description: "Chunk white albacore tuna, cucumbers, onion, red peppers, garbanzo beans, kalamata olives, tomatoes, and feta on a bed of romaine, spinach and arugula. Includes a handmade roll & butter, fresh fruit cup, schwartz brothers bakery oatmeal cookie, athena bottled water & utensils."},
