  {name: "Focaccia Margherita Box Lunch", image: nil, restaurant_id: 47, description: "Fresh mozzarella, slow-roasted tomatoes, whole-leaf basil, with arugula & creamy pesto spread on our own schwartz brothers bakery freshly baked focaccia bread. Includes tim's cascade potato chips, fresh fruit cup, schwartz brothers bakery chocolate chip cookie, athena bottled water & utensils."},
  {name: "Gretchen\u0092s Classic Clubhouse Box Lunch", image: nil, restaurant_id: 47, description: "Fresh roasted turkey breast, ham, maple cured bacon, tillamook cheddar, mayonnaise, lettuce & tomato on schwartz brothers bakery sourdough. Accompanied by tim\u0092s cascade style potato chips, freshly cut fruit, athen bottled water and a schwartz brothers bakery chocolate chip cookie."},
